import React,{useState} from "react";

export const Events = () =>{
    const [show,setShow] = useState(false);

    if(!show){
        return(
            <section>
                <div class="container">
            
                    <h1 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(true)}>Мероприятия   &#8744 </h1>
            
                </div>
            </section>
        )
    }else{
        return(
            <section>
                <div class="container">
            
                    <h1 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(false)}>Мероприятия</h1>
                    <div>
                        Events:
                    </div>
                </div>
            </section>
        )
    }

}
